import React from 'react';
import PageHeader from '../../components/PageHeader/PageHeader';
import DataCard from '../../components/DataCard/DataCard';

export default props => {
  return (
    <div>
      <PageHeader
        title="page header"
        actions={[{ text: 'Add', handler: null }]}
      />
      <DataCard
        data={[
          {
            title: 'Vehicle1',
            body: <div>Body</div>,
            actions: {
              handleAction: null
            }
          },
          {
            title: 'Vehicle2',
            body: <div>Body</div>,
            actions: {
              handleAction: null
            }
          },
          {
            title: 'Vehicle3',
            body: <div>Body</div>,
            actions: {
              handleAction: null
            }
          },
          {
            title: 'Vehicle4',
            body: <div>Body</div>,
            actions: {
              handleAction: null
            }
          }
        ]}
      />
    </div>
  );
};
